import React from "react";
import styles from './experience.module.css';
import {
    Badge
  } from 'reactstrap';

const Experience = () => {
    return (
        <>
        <section id={styles.experienceContainer}>
            <div>
                <h1>Company Name</h1>
                <Badge color="primary" pill>
                    New
                </Badge>

            </div>


        </section>

        </>
    )
}

export default Experience;
